Sarah Silverman: Jesus Is Magic (DVD Rip)

Synopsis: 

Sarah Silverman appears before an audience in Los Angeles with several sketches, taped outside the theater, intercut into the stand-up performance. Themes include race, sex, and religion. Her comic persona is a self-centered hipster, brash and clueless about her political incorrectness. A handful of musical numbers punctuate the performance. It begins and ends with her in conversation with two friends: at the start, she's the loser compared to their recent artistic successes; by the end, she's the star, in her dressing room, dismissive and cutting.


